import React from 'react';
import ReactDOM from 'react-dom';

const App = () => {
    const [whales, setWhales] = useState([]);
    console.log('whales: ', whales);

    const getWhales = async () => {
      const resp = await fetch('http://hotline.whalemuseum.org/api.json');
      const fetchedWhales = await resp.json();
      console.log('fetchedWhales: ', fetchedWhales);
      setWhales(fetchedWhales);
    }

    useEffect(() => {
      getWhales();
    }, []);

    return <div>
      The Whale Hotline
      {
        whales.map(whale => <Whale key={whale.id} whale={whale}/>)
      }
    </div>
  }

  ReactDOM.render(
    <App />,
    document.getElementById('app'),
  );
